import React, { Component } from 'react'
import './index.css'


class Dash extends Component {
  render() {
    return (
      <div className='bg-wrapper-dash'>
        <img alt="example" src='../../bgDash1.png' className='image-dash' />
      </div>
    )
  }
}

export default Dash
